import React, { useState } from 'react'
import { Img, Link, Logo, StyledAppBar, StyledButton, StyledIconButton, StyledNavLinks, StyledNavMobile, StyledToolbar } from './styles'
import { TiThMenu } from 'react-icons/ti'
import logo from '../../assets/logo.svg'
import { Button, Dialog, DialogActions, DialogContent, DialogTitle } from '@material-ui/core'

const Navbar = () => {

    const [open, setOpen] = useState(false);

    const handleMenuOpen = () => {
      setOpen(true);
    };

    const handleMenuClose = () => {
      setOpen(false);
    };

    return (
        <StyledAppBar position="static">
        <StyledToolbar>
          <Logo>
            <Img src={logo} />
            Leiturama
          </Logo>
          <StyledIconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <TiThMenu />
          </StyledIconButton>
          {open && (
            <StyledNavMobile>
              <Link>Planos</Link>
              <Link>Benefícios</Link>
              <Link>Como Funciona</Link>
            </StyledNavMobile>
          )}
          <StyledNavLinks>
            <Link>Planos</Link>
            <Link>Benefícios</Link>
            <Link>Como Funciona</Link>
          </StyledNavLinks>
          <StyledButton variant="outlined">Assinar</StyledButton>
        </StyledToolbar>
      </StyledAppBar>
  )
}

export default Navbar
